Step 1: Multiply the numerators together: $10 \cdot 4 \cdot 6 \cdot 8 \cdot 10 \cdot 12 \cdot 14 \cdot 16 \cdot 18$
Step 2: Multiply the denominators together: $3 \cdot 4 \cdot 5 \cdot 6 \cdot 7 \cdot 8 \cdot 9 \cdot 10 \cdot 11$
Step 3: 
\begin{align*}
\frac{10 \cdot 4 \cdot 6 \cdot 8 \cdot 10 \cdot 12 \cdot 14 \cdot 16 \cdot 18}{3 \cdot 4 \cdot 5 \cdot 6 \cdot 7 \cdot 8 \cdot 9 \cdot 10 \cdot 11}
& = \frac{2^6 \cdot 3^2 \cdot 5 \cdot 7 \cdot 11 \cdot 2^3 \cdot 3 \cdot 5^2 \cdot 2^2 \cdot 3^2}{2^3 \cdot 3^1 \cdot 5^1 \cdot 2^3 \cdot 3^1 \cdot 7^1 \cdot 2^3 \cdot 3^2 \cdot 5^1 \cdot 11^1}
\begin{align*}
\frac{2^6 \cdot 3^2 \cdot 5 \cdot 7 \cdot 11 \cdot 2^3 \cdot 3 \cdot 5^2 \cdot 2^2 \cdot 3^2}{2^3 \cdot 3^1 \cdot 5^1 \cdot 2^3 \cdot 3^1 \cdot 7^1 \cdot 2^3 \cdot 3^2 \cdot 5^1 \cdot 11^1} &= \frac{\cancel{2}^7 \cdot \cancel{3}^4 \cdot 5^3 \cdot 7 \cdot 11}{\cancel{2}^9 \cdot \cancel{3}^3 \cdot 5^2 \cdot 7 \cdot \cancel{11}}
\end{align*}
\begin{align*}
\frac{2^7 \cdot 3^4 \cdot 5^3 \cdot 7 \cdot 11}{2^9 \cdot 3^3 \cdot 5^2 \cdot 7 \cdot 11} &= \frac{2^{-2} \cdot 3^1 \cdot 5^1}{1}
\end{align*}
\begin{align*}
\frac{2^7 \cdot 3^4 \cdot 5^3 \cdot 7 \cdot 11}{2^9 \cdot 3^3 \cdot 5^2 \cdot 7 \cdot 11} &= \frac{2^{-2} \cdot 3^1 \cdot 5^1}{1} \\
& = \frac{\frac{1}{4} \cdot 3 \cdot 5}{1} \\
& = \frac{15}{4}
\end{align*}
\begin{align*}
\frac{2^7 \cdot 3^4 \cdot 5^3 \cdot 7 \cdot 11}{2^9 \cdot 3^3 \cdot 5^2 \cdot 7 \cdot 11} &= \frac{2^{-2} \cdot 3^1 \cdot 5^1}{1} \\
& = \frac{\frac{1}{4} \cdot 3 \cdot 5}{1} \\
& = \frac{15}{4}
\end{align*}
